"use strict";(self.webpackChunkdoc=self.webpackChunkdoc||[]).push([[74588],{74588:n=>{n.exports='<div class="container">\n  <prizm-panel header="\u0417\u0430\u0433\u043e\u043b\u043e\u0432\u043e\u043a">\n    <div class="toggle-container" instruments>\n      <button\n        [icon]="\'editor-panel-right\'"\n        [pseudoPressed]="isSideMenuOpened"\n        (click)="toggleSideMenu()"\n        prizmIconButton\n        appearanceType="ghost"\n        appearance="secondary"\n        size="m"\n      ></button>\n    </div>\n  </prizm-panel>\n  <div class="content" [class.content_column]="sideMenuType === \'col\'">\n    <div class="content__inner">\n      <prizm-listing-item\n        *ngFor="let el of elementList; let idx = index"\n        [selected]="idx === selectedElementIdx"\n        (click)="toggleElementState(idx)"\n      >\n        {{ el }}\n      </prizm-listing-item>\n    </div>\n\n    <div class="side-menu" *ngIf="isSideMenuOpened">\n      <div class="header">\n        <prizm-panel header="Side Menu">\n          <div class="instruments" instruments>\n            <div class="instruments__group">\n              <prizm-icon\n                class="instruments__icon"\n                [size]="16"\n                (click)="changeSideMenuType()"\n                iconClass="editor-down-1"\n              ></prizm-icon>\n            </div>\n\n            <div class="instruments__group">\n              <prizm-icon\n                class="instruments__icon"\n                [size]="16"\n                iconClass="cancel-delete-content"\n              ></prizm-icon>\n              <prizm-icon class="instruments__icon" [size]="16" iconClass="tools-content-save"></prizm-icon>\n            </div>\n          </div>\n        </prizm-panel>\n      </div>\n      <div class="side-menu__content" [class.side-menu__content_empty]="selectedElementIdx === -1">\n        <div class="input" *ngIf="selectedElementIdx > -1">\n          <prizm-input-layout [style.width.%]="100" [label]="\'\u0417\u0430\u0433\u043e\u043b\u043e\u0432\u043e\u043a \' + (selectedElementIdx + 1)">\n            <input prizmInput value="\u041a\u043e\u043d\u0442\u0435\u043d\u0442" />\n          </prizm-input-layout>\n        </div>\n        <div class="empty-message" *ngIf="selectedElementIdx === -1">\n          <span class="empty-message__main">\u041d\u0435\u0442 \u0434\u0430\u043d\u043d\u044b\u0445 \u0434\u043b\u044f \u043e\u0442\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u044f</span>\n          <span class="empty-message__sub"\n            >\u0427\u0442\u043e\u0431\u044b \u043f\u0440\u043e\u0441\u043c\u043e\u0442\u0440\u0435\u0442\u044c \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044e \u0432 \u044d\u0442\u043e\u0439 \u043e\u0431\u043b\u0430\u0441\u0442\u0438 \u043d\u0443\u0436\u043d\u043e \u0438\u0437\u043c\u0435\u043d\u0438\u0442\u044c \u0443\u0441\u043b\u043e\u0432\u0438\u044f \u043e\u0442\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u044f \u0438\u043b\u0438\n            \u0444\u0438\u043b\u044c\u0442\u0440\u0430\u0446\u0438\u0438.</span\n          >\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n'}}]);